import logo from './logo.svg';
import './App.css';


axios.get('/user', {
  params: {
    ID: 12345
  }
})
.then(function (response) {
  console.log(response);
})
.catch(function (error) {
  console.log(error);
})
.finally(function () {
  // always executed
});
function App() {
  return (
    <div className="App">
      <h1>MovieFind</h1>
      <h2>Find the perfect movie for you.</h2>
      <input type="text" placeholder="Search" name="search"></input>
    </div>
  );
}

export default App;
